{
  "translationLines": [
    {
      "lineNumber": 244862,
      "originalJapaneseLine": "「いいか皆の者！",
      "translatedEnglishLine": "Listen up, everyone!"
    },
    {
      "lineNumber": 244863,
      "originalJapaneseLine": "　両部隊は既にボロボロだ！」",
      "translatedEnglishLine": "Both units are already in tatters!"
    },
    {
      "lineNumber": 244864,
      "originalJapaneseLine": "「つまり、マエリータ隊を殺すチャンスだ！",
      "translatedEnglishLine": "In other words, this is our chance to kill Maerita's squad!"
    },
    {
      "lineNumber": 244865,
      "originalJapaneseLine": "　一切の遠慮なく、磨り潰してやれ！」",
      "translatedEnglishLine": "Crush them without any hesitation!"
    },
    {
      "lineNumber": 244866,
      "originalJapaneseLine": "「なんだぁ？　敵の増援かと思ったら",
      "translatedEnglishLine": "What? I thought they were enemy reinforcements,"
    },
    {
      "lineNumber": 244867,
      "originalJapaneseLine": "　あいつらマエリータ隊の敵なのか？」",
      "translatedEnglishLine": "but are those guys enemies of Maerita's squad?"
    },
    {
      "lineNumber": 244868,
      "originalJapaneseLine": "「私の隊は……",
      "translatedEnglishLine": "My squad is..."
    },
    {
      "lineNumber": 244869,
      "originalJapaneseLine": "　魔軍内でも嫌われ者の隊ですからね……",
      "translatedEnglishLine": "a despised unit even within the demon army..."
    },
    {
      "lineNumber": 244870,
      "originalJapaneseLine": "　いつか、こんな日が来るとは思ってました」",
      "translatedEnglishLine": "I always thought a day like this would come."
    },
    {
      "lineNumber": 244871,
      "originalJapaneseLine": "「しかし、このタイミングとはね……」",
      "translatedEnglishLine": "But of all timings, it's now..."
    },
    {
      "lineNumber": 244872,
      "originalJapaneseLine": "「魔軍内でも色々とあるようだ」",
      "translatedEnglishLine": "It seems there's a lot going on within the demon army."
    },
    {
      "lineNumber": 244873,
      "originalJapaneseLine": "「この卑怯者共がァ！",
      "translatedEnglishLine": "You cowards!"
    },
    {
      "lineNumber": 244874,
      "originalJapaneseLine": "　テメェらどこの大将軍の命令でやってきた！」",
      "translatedEnglishLine": "Under which great general's orders did you come?"
    },
    {
      "lineNumber": 244875,
      "originalJapaneseLine": "「馬鹿が！　そんなこと答えると思ったか！」",
      "translatedEnglishLine": "Fools! Did you think I'd answer that?"
    },
    {
      "lineNumber": 244876,
      "originalJapaneseLine": "「だが、察している通り、",
      "translatedEnglishLine": "But as you might have guessed,"
    },
    {
      "lineNumber": 244877,
      "originalJapaneseLine": "　我々がマエリータ隊の",
      "translatedEnglishLine": "it is true that we were assigned"
    },
    {
      "lineNumber": 244878,
      "originalJapaneseLine": "　襲撃任務を受けたことは事実だ」",
      "translatedEnglishLine": "the mission to attack Maerita's squad."
    },
    {
      "lineNumber": 244879,
      "originalJapaneseLine": "「しかし、マエリータ隊を追ってみれば",
      "translatedEnglishLine": "However, when we followed Maerita's squad,"
    },
    {
      "lineNumber": 244880,
      "originalJapaneseLine": "　カオスマスターの部隊まで釣れるとはな」",
      "translatedEnglishLine": "we even managed to lure the Chaos Master's unit."
    },
    {
      "lineNumber": 244881,
      "originalJapaneseLine": "「くくく……これで魔剣カオスまで持って帰れば、",
      "translatedEnglishLine": "Heh heh heh... if I bring back the Chaos Demon Sword with this,"
    },
    {
      "lineNumber": 244882,
      "originalJapaneseLine": "　私の出世は間違いないぞ……」",
      "translatedEnglishLine": "my promotion is guaranteed..."
    },
    {
      "lineNumber": 244883,
      "originalJapaneseLine": "「戦闘用ーーーー意！」",
      "translatedEnglishLine": "Prepare for battle!"
    },
    {
      "lineNumber": 244884,
      "originalJapaneseLine": "「目標はマエリータ隊、カオスマスター部隊！",
      "translatedEnglishLine": "Targets are Maerita's squad and the Chaos Master's unit!"
    },
    {
      "lineNumber": 244885,
      "originalJapaneseLine": "　両隊まとめて相手してやれ！」",
      "translatedEnglishLine": "Take on both squads at once!"
    },
    {
      "lineNumber": 244886,
      "originalJapaneseLine": "「魔物は自由に生きるべきだ！」",
      "translatedEnglishLine": "Monsters should live freely!"
    },
    {
      "lineNumber": 244887,
      "originalJapaneseLine": "「お互いの力を競い合い、伸ばし、",
      "translatedEnglishLine": "Competing and growing stronger together,"
    },
    {
      "lineNumber": 244888,
      "originalJapaneseLine": "　存分に強くなれる……",
      "translatedEnglishLine": "becoming as strong as possible..."
    },
    {
      "lineNumber": 244889,
      "originalJapaneseLine": "　それが魔物の理想郷の筈！」",
      "translatedEnglishLine": "That's supposed to be the monsters' utopia!"
    },
    {
      "lineNumber": 244890,
      "originalJapaneseLine": "「私はそんな世界を作ろうとしている！",
      "translatedEnglishLine": "I am trying to create such a world!"
    },
    {
      "lineNumber": 244891,
      "originalJapaneseLine": "　それがどうして貴方達には分からない！」",
      "translatedEnglishLine": "How is it that you all don't understand that?"
    },
    {
      "lineNumber": 244892,
      "originalJapaneseLine": "「そんなことは俺には関係ないからだ！",
      "translatedEnglishLine": "That has nothing to do with me!"
    },
    {
      "lineNumber": 244893,
      "originalJapaneseLine": "　死ね！」",
      "translatedEnglishLine": "Die!"
    },
    {
      "lineNumber": 244894,
      "originalJapaneseLine": "「なら、私が味方するわ」",
      "translatedEnglishLine": "Then, I'll side with you."
    },
    {
      "lineNumber": 244895,
      "originalJapaneseLine": "「なっ……」",
      "translatedEnglishLine": "Wha...?"
    },
    {
      "lineNumber": 244896,
      "originalJapaneseLine": "「こらー！　勝手なことをするなー！」",
      "translatedEnglishLine": "Hey! Don't do things on your own!"
    },
    {
      "lineNumber": 244897,
      "originalJapaneseLine": "「ランス君、仕方ないから共闘しましょうよ。",
      "translatedEnglishLine": "Lance, it can't be helped, let's team up."
    },
    {
      "lineNumber": 244898,
      "originalJapaneseLine": "　連中私達も目標に入れてるし」",
      "translatedEnglishLine": "They're targeting us as well."
    },
    {
      "lineNumber": 244899,
      "originalJapaneseLine": "「ぐ、ぐぬぬぬぬ……」",
      "translatedEnglishLine": "Grrrrr..."
    },
    {
      "lineNumber": 244900,
      "originalJapaneseLine": "「ええい！　しゃーない！",
      "translatedEnglishLine": "Ugh! Fine, whatever!"
    },
    {
      "lineNumber": 244901,
      "originalJapaneseLine": "　行くぞお前ら！」",
      "translatedEnglishLine": "Let's go, everyone!"
    },
    {
      "lineNumber": 244902,
      "originalJapaneseLine": "「目標変更！",
      "translatedEnglishLine": "Target changed!"
    },
    {
      "lineNumber": 244903,
      "originalJapaneseLine": "　魔物部隊を殲滅します！」",
      "translatedEnglishLine": "We will annihilate the monster units!"
    },
    {
      "lineNumber": 244904,
      "originalJapaneseLine": "「生意気な……」",
      "translatedEnglishLine": "How presumptuous..."
    },
    {
      "lineNumber": 244905,
      "originalJapaneseLine": "「踏み潰してやれぇい！」",
      "translatedEnglishLine": "Crush them!"
    },
    {
      "lineNumber": 244906,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 244907,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 244908,
      "originalJapaneseLine": "「……終わりましたね」",
      "translatedEnglishLine": "...It's over now."
    },
    {
      "lineNumber": 244909,
      "originalJapaneseLine": "敵の部隊が200匹前後の中隊であったこと、",
      "translatedEnglishLine": "Since the enemy forces were roughly a company of about 200,"
    },
    {
      "lineNumber": 244910,
      "originalJapaneseLine": "相手に油断があったことが幸いし、",
      "translatedEnglishLine": "and they were careless, fortunately,"
    },
    {
      "lineNumber": 244911,
      "originalJapaneseLine": "なんとかランス達は生き残っていた。",
      "translatedEnglishLine": "Lance and the others managed to survive."
    },
    {
      "lineNumber": 244912,
      "originalJapaneseLine": "「なんと礼を言えばいいか……」",
      "translatedEnglishLine": "I don't know how to thank you..."
    },
    {
      "lineNumber": 244913,
      "originalJapaneseLine": "「あ、いえ、お礼なんて……",
      "translatedEnglishLine": "Ah, no, no need for thanks..."
    },
    {
      "lineNumber": 244914,
      "originalJapaneseLine": "　私達も助けてもらいましたし……」",
      "translatedEnglishLine": "We were helped as well..."
    },
    {
      "lineNumber": 244915,
      "originalJapaneseLine": "「ふっ……」",
      "translatedEnglishLine": "Heh..."
    },
    {
      "lineNumber": 244916,
      "originalJapaneseLine": "「えへへ……」",
      "translatedEnglishLine": "Hehe..."
    },
    {
      "lineNumber": 244917,
      "originalJapaneseLine": "「って、こら」",
      "translatedEnglishLine": "Hey, you!"
    },
    {
      "lineNumber": 244918,
      "originalJapaneseLine": "「きゃん！」",
      "translatedEnglishLine": "Kyaa!"
    },
    {
      "lineNumber": 244919,
      "originalJapaneseLine": "ランスがシィルのお尻にランスキーック。",
      "translatedEnglishLine": "Lance gave Seal a Lance Kick on her butt."
    },
    {
      "lineNumber": 244920,
      "originalJapaneseLine": "「い、痛いですぅ、ランス様……」",
      "translatedEnglishLine": "I-It hurts, Lord Lance..."
    },
    {
      "lineNumber": 244921,
      "originalJapaneseLine": "「何を敵と仲良くなっとるか。",
      "translatedEnglishLine": "What are you doing getting friendly with the enemy?"
    }
  ]
}

